import React from 'react'
import './Admincss.css';

export default function Adminlogin() {
  return (
    <div className='adm'>
      <div className='log'>
        <label className='lb1'>Us</label>
        <input className='inp1' placeholder='Enter Username' type='text'/>
      </div>
    </div>
  )
}
